import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './components/LoginPage'; // Certifique-se de que o caminho está correto
import Foods from './components/Foods'; // Este será um novo componente para a lista de alimentos

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />  // Rota para a página de login
        <Route path="/foods" element={<Foods />} /> // Rota para mostrar a lista de alimentos
      </Routes>
    </Router>
  );
}

export default App;
